DROP TABLE IF EXISTS super_heroes;
CREATE TABLE IF NOT EXISTS super_heroes(
   auto_incre INTEGER  NOT NULL PRIMARY KEY 
  ,nombre     VARCHAR(25) NOT NULL
  ,genero     VARCHAR(6) NOT NULL
  ,color_ojos VARCHAR(23) NOT NULL
  ,raza       VARCHAR(18) NOT NULL
  ,color_pelo VARCHAR(16) NOT NULL
  ,estatura   NUMERIC(5,1) NOT NULL
  ,editorial  VARCHAR(17)
  ,color_piel VARCHAR(14) NOT NULL
  ,alineacion VARCHAR(7) NOT NULL
  ,peso       NUMERIC(5,1)
);
